import './App.css';
import Nav from './Nav'
import axios from 'axios'
import React,{useState, useEffect} from 'react'

function App() {
const [posts, setPosts] = useState([]);
const fetchPosts = () =>{
  axios
  .get(`http://localhost:4000/api/posts`)
  .then(response =>{
    console.log(response);
    setPosts(response.data)
  })
  .catch(error => alert('May mali sa code mo bai'));
} 
useEffect(() => {
    fetchPosts();
  },[])
  return (
    <div>
    <Nav></Nav >
    {
      posts.map((post, i)=>(
       <div>
        <div class="row">
  <div class="col-sm-5 col-md-6">{post.title}</div>
  <div class="col-sm-5 offset-sm-2 col-md-6 offset-md-0">{post.slug}</div>
</div>

<div class="row">
  <div class="col-sm-6 col-md-5 col-lg-6">{}</div>
  <div class="col-sm-6 col-md-5 offset-md-2 col-lg-6 offset-lg-0">.col-sm-6 .col-md-5 .offset-md-2 .col-lg-6 .offset-lg-0</div>
</div>
       </div>
      ))
    }
    </div>
  );
}

export default App;
